import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import * as RegEx from '../regex'; // Import regex validation methods

function Signup() {
    const [fullName, setFullName] = useState('');
    const [accountnum, setAccountnum] = useState('');
    const [idNumber, setIdNumber] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');
    const [errorMessage, setErrorMessage] = useState('');
    const [isLoading, setIsLoading] = useState(false);
    const navigate = useNavigate();

    const handleSubmit = async (e) => {
        e.preventDefault();

        // Validation for full name (alphabetic characters only)
        if (!RegEx.testAlphabet(fullName)) {
            setErrorMessage('Full name should only contain letters');
            return;
        }

        // Validate ID number (alphanumeric only)
        if (!RegEx.testAlphanumerical(idNumber)) {
            setErrorMessage('ID number should only contain letters and numbers');
            return;
        }

        // Validate password strength
        if (!RegEx.testPassword(password)) {
            setErrorMessage('Password is too weak');
            return;
        }

        // Check if passwords match
        if (password !== confirmPassword) {
            setErrorMessage('Passwords do not match');
            return;
        }

        setIsLoading(true);
        setErrorMessage(''); // Reset error message

        try {
            const response = await axios.post('http://localhost:5000/api/signup', {
                fullName,
                accountnum,
                idNumber,
                password,
                confirmPassword,
            });

            if (response.status === 201) {
                // Redirect to login page after successful signup
                navigate('/login');
            }
        } catch (error) {
            console.error(error);
            if (error.response) {
                setErrorMessage(error.response.data.message || 'Something went wrong');
            } else {
                setErrorMessage('Network error');
            }
        } finally {
            setIsLoading(false);
        }
    };

    return (
        <div className="signup-container">
            <h2>Sign Up</h2>
            {errorMessage && <p className="error-message">{errorMessage}</p>}
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label htmlFor="fullName">Full Name:</label>
                    <input
                        type="text"
                        id="fullName"
                        value={fullName}
                        onChange={(e) => setFullName(e.target.value)}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="accountnum">Account Number:</label>
                    <input
                        type="text"
                        id="accountnum"
                        value={accountnum}
                        onChange={(e) => setAccountnum(e.target.value)}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="idNumber">ID Number:</label>
                    <input
                        type="text"
                        id="idNumber"
                        value={idNumber}
                        onChange={(e) => setIdNumber(e.target.value)}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="password">Password:</label>
                    <input
                        type="password"
                        id="password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="confirmPassword">Confirm Password:</label>
                    <input
                        type="password"
                        id="confirmPassword"
                        value={confirmPassword}
                        onChange={(e) => setConfirmPassword(e.target.value)}
                        required
                    />
                </div>
                <button type="submit" disabled={isLoading}>
                    {isLoading ? 'Signing up...' : 'Sign Up'}
                </button>
            </form>
        </div>
    );
}

export default Signup;
